const FriendPage = () => {
  return (
    <div className={styles.container}>
      <div className={styles.FriendList}>
        <AddFriends />
        {<FriendList />}
      </div>
      {/* <div className={styles.AddFriends}>

      </div> */}
    </div>
  );
};

export default FriendPage;
